import './Login.css';
import React from 'react';


function Login() {

  const [message, setMessage]=useState([]);

  useEffect(()=>{
    fetch("/user/social-login")
        .then((response)=>{
          return response.json();
        })
        .then((data)=>{
            setMessage(data);
        });
  },[]);


  return (
    <div className="Login">
     <div className="main">
      <span>MediHistory</span>
     </div>
     <div className="sub">
     <span>개인 진료 정보 조회</span>
     </div>

    <div className='login-buttons'>
      
    <div className='kakao-button'>
    <a href="https://kauth.kakao.com/oauth/authorize?client_id={YOUR_CLIENT_ID}&redirect_uri={YOUR_REDIRECT_URI}&response_type=code">
        <button className="kakao-login">
          <img src="\kakao_logo.png" width="100" height="130" alt="kakao"/>
        </button>
      </a>
    </div>

    <div className="naver-button"> 
    <a>
        <button className="naver-login" onClick={useEffect}>
          <img src="\naver_logo.png" width="100" height="130" alt="naver"/>
        </button>
      </a>
    </div>
    </div>


    </div>
  );
}

export default Login;
